import PropTypes from "prop-types";

import { Carousel } from "./../../../../components";
export const SelectProgram = ({ data }) => {
  console.dir(data);
  const { programs } = data;
  return (
    <div className="d-block pt-5">
      <h2 className="fw-bold pb-4">Select Workout Program</h2>
      <Carousel>
        {programs.map((program) => {
          return (
            <div key={program.key}>
              {program.id}
              {program.days}
              {program.name}
            </div>
          );
        })}
      </Carousel>
    </div>
  );
};

SelectProgram.propTypes = {
  data: PropTypes.shape({ programs: PropTypes.arrayOf(PropTypes.object) }),
};
